function MCStories() {
  return (
    <div>
      <Stories
        stories={[
          { url: sr1},
          { url: sr2},
          { url: sr4}
          // { url: sr3, type: 'video'}
        ]}
        defaultInterval={5000}
        width={"100%"}
        height={800}
        loop={true}
      />
    </div>
  );
}

export default MCStories;
